  false,\n\t\"url\": null,\n\t\"notes\": \"To assist with the Comprehensive Conservation
  Plan process, Huron Wetland Management District (WMD) requested that information
  be synthesized on ecological restoration approaches for grasslands that would help
  them develop goals and objectives to achieve a desired grassland condition defined
  as a u201ca mixture of native grasses and forbs that provide the structure and foods
  necessary to support target migratory bird species.u201d  This document is an integration
  of  information relevant to Huron WMD from different scientific disciplines to address
  ecological drivers such as soils, moisture, and climate that are primary determinates
  of plant germination.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
